import React from 'react'

 const Posts = ({posts}) => {
   
    return (
        
       
        <ul className="list-group mb-4">
            {posts.map(post=>(
               
                <li key={post.id} className='list-group-item'>
                    {post.id} | {post.userReviewer} 
                    | {post.assignment.comment} 
                </li>
            ))}

        </ul>
       
    )
}


export default Posts
